import React, { Component } from "react";

export default class Task extends Component {
  constructor(props) {
    super(props);
  }

  show_current_task = () => {
    title = this.props.title
    content = this.props.content
    date_ending = this.props.date_ending
    console.log(title)
    this.props.show_task(title, content, date_ending)
  }

  render() {
    return (
      <div className="card task_card" task_id="1">
        <div className="card-body">
          <div className="task_header">
            <a href="" onClick={this.show_current_task}>{this.props.title}</a>
          </div>
          <div className="task_date">{this.props.date_ending}</div>
        </div>
      </div>
    );
  }
}
